        string memory _serialNumber
    )
        external
        view
        returns (
            string memory,
            string memory,
            string memory,
            string memory,
            uint256,
            uint256,
            address,
            address,
            ProductStatus,
            address[] memory
        );

    function updateProduct(
        string memory _serialNumber,
